 *      fromPairs([['a', 1], ['b', 2], ['c', 3]]); //=> {a: 1, b: 2, c: 3}
 */
export default ((arr = []) => {
    const result = {};
    for (let i = 0; i < arr.length; i++) {
        result[arr[i][0]] = arr[i][1];
    }
